import React, { useEffect, useState } from "react";
import { parse } from "qs";

const App = () => {
  const [name, setName] = useState(true);

  const ok = boolean => {
    if (setName === boolean) {
      alert("Hello");
    } else {
      console.log(name);
    }
  };
  ok(false);

  useEffect(() => {
    let data = [
      {
        pseudo: "Moussa",
        age: 27,
        admin: true,
        voiture: "Mercedes"
      },
      {
        pseudo: "Dorian",
        age: 77,
        admin: false,
        voiture: "Bmw"
      },
      {
        pseudo: "Mlll",
        age: 37,
        admin: false,
        voiture: "seat"
      },
      {
        pseudo: "MSYry",
        age: 17,
        admin: false,
        voiture: "Peugeot"
      }
    ];

    data
      .filter(ok => ok.age > 19)
      .filter(ok => ok.admin === true)
      .sort((a, b) => b.age - a.age)
      .map(myData => console.log(myData));
  });

  return <></>;
};

export default App;
